import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <ul>
        allCountryScores.map((ability, index) => (<li key={index}>{ability}</li>
        ))
      </ul>
    </div>
  );
}

export default App;
